import styled from "styled-components";

export const ServicesContainer = styled.div`
    height : 800px;
    display : flex;
    flex-direction : column;
    justify-content : center;
    align-items : center;
    background : #010606;

    @media screen and (max-width: 768px){
        height : 1100px;
    }

`
